«Как измерить кислород в крови: 
1. Наденьте часы на ширину одного пальца ниже запястья и носите их в удобном положении на запястье; 
2. После входа в режим определения кислорода в крови не двигайтесь, убедитесь, что ваше запястье ровно, а часы смотрят вверх. Если вы сидите, вы можете положить руки на стол часами вверх;
3. Пожалуйста, держите руку неподвижно, пока не получите окончательный результат .
